// Helper function, should be part of the weather station library and should disappear soon
const unsigned short* getIcon(String iconText) {
  if (iconText == "01d" || iconText == "01n") return sunny;
  if (iconText == "02d" || iconText == "02n") return partlysunny;
  if (iconText == "03d" || iconText == "03n") return partlycloudy;
  if (iconText == "04d" || iconText == "04n") return mostlycloudy;
  if (iconText == "09d" || iconText == "09n") return rain;
  if (iconText == "10d" || iconText == "10n") return rain;
  if (iconText == "11d" || iconText == "11n") return tstorms;
  if (iconText == "13d" || iconText == "13n") return snow;
  if (iconText == "50d" || iconText == "50n") return fog;
  return unknown;
}

const unsigned short* getSmallIcon(String iconText) {
  if (iconText == "01d" || iconText == "01n") return sunny_small;
  if (iconText == "02d" || iconText == "02n") return partlysunny_small;
  if (iconText == "03d" || iconText == "03n") return partlycloudy_small;
  if (iconText == "04d" || iconText == "04n") return mostlycloudy_small;
  if (iconText == "09d" || iconText == "09n") return rain_small;
  if (iconText == "10d" || iconText == "10n") return rain_small;
  if (iconText == "11d" || iconText == "11n") return tstorms_small;
  if (iconText == "13d" || iconText == "13n") return snow_small;
  if (iconText == "50d" || iconText == "50n") return fog_small;
  return unknown_small;
}
